import data from './data'

function App() {
  return (
    <div className="App">
      <h1>Pokedex</h1>
      <div> {/* Javascript coloca entre { } */}
        {data.map(element =>  
          <div key={element.id}>
            {element.name} 
          </div>)}
      </div> 
    </div>
  );
}

export default App;
